  render() {
    return (
      <div>
        <Layout>
          <h1>Phonebook</h1>
          <ContactForm />
          <h2>Contacts</h2>
          <Filter value={value} />
          <GlobalStyle />
        </Layout>
      </div>
    );
  }
}
